import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
const QuiSuisje = () => {
  return (
    <div>
      <div className="typewriter-container">
        <div className="typewriter">
          <h1 className="text-success text-decoration-underline">
            Qui suis-je?
          </h1>
        </div>
      </div>
      <Row>
        <Col sm={6}> <img
              className="img-fluid"
              src="./img/japan-anime.gif"
              alt="image propriétaire"
            ></img></Col>
        <Col sm={6}><p> Je suis un développeur web Junior</p></Col>
      </Row>
    </div>
  );
};

export default QuiSuisje;
